column8:
保冷なのにコンパクトに畳んで持ち運べる、とっても便利なエコバッグ。<br />
買い物かごいっぱいの買い物をしてもOK。<br />
スタイリッシュな柄を取り揃えました。<br />
<br />
見た目以上にたっぷり入る、安心サイズです。<br />
<br />
内側にメッシュポケット付。<br />
保冷剤を入れて、しっかり冷やすこともできます！<br />
<br />
<br />
